import React from 'react';
import './FarmAnimalCard.css';

export class FarmAnimalCard extends React.Component{
render(){

    return(
        <div className="card">
             <img src="https://portal-amb-imgs.clubedaana.com.br/2020/06/novo-v%C3%ADrus-gripe-porco.jpg" 
                  class="card-img-top" 
                  alt="..."> 
             </img>
        <div class="card-body">
             <h5 class="card-title">Card title</h5>
             <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="https://www.noticiasdecoimbra.pt/wp-content/uploads/2019/05/porco.jpg?x75216" 
       class="btn btn-primary">
           Go somewhere
       </a>
  </div>
</div>
    );
}
}
